//File containing functions for the game's menu bar

#include <stdint.h>
#include "../inc/tm4c123gh6pm.h"
#include "ST7735.h"
#include "ADC.h"

const unsigned short MenuDisappear[];
const unsigned short ButtonMenu[];
const unsigned short AngleSlide[];
const unsigned short PowerSlide[];
const unsigned short MenuArrow[];
const unsigned short MoveMenu[];
const unsigned short MenuArrowDisappear[];
const unsigned short Player1[];
const unsigned short Player2[];
const unsigned short DeleteTurn[];

typedef struct{
	const int x;
	int y;
	int previousY;
} arrow_t;

int arrowLocs[4] = {140, 105, 62, 25};
arrow_t arrow = {25, 25, 25};


void PrintButtonMenu(){
	ST7735_DrawBitmap(0, 159, ButtonMenu, 38, 160);
}
void ClearMenu(){
	ST7735_DrawBitmap(0, 159, MenuDisappear, 38, 160);
}
void PrintAngleMenu(){
	ST7735_DrawBitmap(0, 159, AngleSlide, 38, 160);
}
void PrintPowerMenu(){
	ST7735_DrawBitmap(0, 159, PowerSlide, 38, 160);
}

void PrintMoveMenu(){
	ST7735_DrawBitmap(0, 159, MoveMenu, 38, 160);
}

void PrintPlayer1Turn(){
	ST7735_DrawBitmap(115, 159, Player1, 14, 160);
}

void PrintPlayer2Turn(){
	ST7735_DrawBitmap(115, 159, Player2, 14, 160);
}

void PrintDeleteTurn(){
	ST7735_DrawBitmap(115, 159, DeleteTurn, 14, 160);
}


void PrintArrow(){
	if (arrow.previousY != arrow.y)
		ST7735_DrawBitmap(arrow.x, arrow.previousY, MenuArrowDisappear, 6, 9);
	ST7735_DrawBitmap(arrow.x, arrow.y, MenuArrow, 6, 9);
	arrow.previousY = arrow.y;
}

void ReturnArrow(int x){
	arrow.y = arrowLocs[x];
	PrintArrow();
}

void MoveArrowLeft(){
	if (arrow.y == arrowLocs[0]){
		arrow.y = arrowLocs[1];
		PrintArrow();
	}
	else if (arrow.y == arrowLocs[1]){
		arrow.y = arrowLocs[2];
		PrintArrow();
	}
	else if (arrow.y == arrowLocs[2]){
		arrow.y = arrowLocs[3];
		PrintArrow();
	}
	else if (arrow.y == arrowLocs[3]){
		arrow.y = arrowLocs[0];
		PrintArrow();
	}
	else{
		ReturnArrow(0);
	}
}


void MoveArrowRight(){
	if (arrow.y == arrowLocs[0]){
		arrow.y = arrowLocs[3];
		PrintArrow();
	}
	else if (arrow.y == arrowLocs[1]){
		arrow.y = arrowLocs[0];
		PrintArrow();
	}
	else if (arrow.y == arrowLocs[2]){
		arrow.y = arrowLocs[1];
		PrintArrow();
	}
	else if (arrow.y == arrowLocs[3]){
		arrow.y = arrowLocs[2];
		PrintArrow();
	}
	else{
		ReturnArrow(0);
	}
}

void SliderMoveArrow(int val){
	arrow.y = val*2/51;
	PrintArrow();
}



